import TabHeader from "./tabHeader"
import { Link } from "react-router-dom"

const Profile = () => {
    return( 
        <TabHeader>
            <Link to ='profile'>Perfil</Link>
        </TabHeader>
    )
}

const recipe1 = {
    name: 'recipe1',
    ingredients: [
        {
            name: 'cheese',
            quantity: 2
        },
        {
            name:'bread',
            quantity: 3
        }
    ]
}
const recipe2 = {
    name: 'recipe2',
    ingredients: [
        {
            name: 'butter',
            quantity: 1
        },
        {
            name:'salt',
            quantity: 1
        }
    ]
}

const recipesList = [recipe1, recipe2];

export default Profile;
